import styled from 'styled-components'


export default styled.div`
grid-area: AD;
display: flex;
  div.doc{
    flex-direction:row;
    width: 80%;
  overflow-x: scroll;
  /* ::-webkit-scrollbar { 
    display: none;
  } */
  div{
    justify-content: space-between;
    align-items: center;
  }
  }
`
